package asdasdasd0328;

public class GUGUDAN {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i =1; i<=9; i++) {
			for(int j=9; j>=1; j-=1){
				System.out.print(j+"*"+i+"="+(i*j)+" "); // print는 줄안바꾸는거 println은 줄바꾸는거 //
			}
			System.out.println(" "); // 구구단 역수에 두줄은 홀 두줄은 짝 // 
		}

	}

}
